// SPDX-License-Identifier: GPL-3.0
pragma solidity ^0.8.2;

contract VoterContract{

    address private owner;
    address private keyHolder = 0xd9145CCE52D386f254917e481eB44e9943F39138;

    mapping(address=>bool) private VOTERS;
    mapping(uint16 => mapping(address => uint)) private votePower;

    /*
    0 -> Closed
    1 -> Opened and type is No Yes (1 for No and 2 for Yes)
    2 -> Opened and type is No 1 ... 10 Yes
    */

    string public topic;

    uint16 private voteId = 0;
    uint8 private votingType = 0;

    uint16 private totalVoterCount = 0;
    uint16 private voted = 0;

    uint256 private result = 0;

    constructor() {
        owner = msg.sender;
    }

    modifier onlyKeyHolder {
        require(msg.sender == keyHolder);
        _;
    }

    modifier onlyOwner{
        require(msg.sender == owner);
        _;
    }

    modifier noZeroAddress(address adr){
        require(adr!=address(0));
        _;
    }

    modifier onlyVoters(address adr){
        require(VOTERS[adr]);
        _;
    }
    modifier onlyNotVotedVoters{
        require(VOTERS[msg.sender]);
        require(votePower[voteId][msg.sender]==0);
        _;
    }
    modifier votingStarted {
        require(votingType!=0);
        _;
    }

    modifier votingEnded {
        require(votingType!=0);
        _;
    }

    function changeKeyHolder(address adr) external onlyOwner{
        keyHolder = adr;
    }

    function giveVotingPower(address voterAddress) external onlyKeyHolder noZeroAddress(voterAddress) {
        totalVoterCount = totalVoterCount + 1;
        VOTERS[voterAddress] = true;
    }

    function openVoting(uint8 _votingType) external onlyOwner votingStarted {
        votingType = _votingType;
        result = 0;
        voted = 0;
        //EMIT
    }

    function closeVoting() external onlyOwner votingEnded{
        votingType = 0;
        voteId = voteId+1;
        //EMIT
    }

    function getResult() external view returns(uint256){
        return result;
    }

    function getVoted() external view returns(uint256){
        return voted;
    }

    function useVotePowerYesNo(bool vote) external votingStarted onlyNotVotedVoters{
        if(vote){
            votePower[voteId][msg.sender] = 1;
            result += 1;
        }else{
            votePower[voteId][msg.sender] = 10;
            result += 10;
        }

        voted += 1;
    }
    
    function useVotePowerONE_TEN(uint256 vote) external votingStarted onlyNotVotedVoters{
        require(vote<11);
        result += vote;
        voted += 1;
        votePower[voteId][msg.sender] = vote;
    }
}

